// import { deepblue, navyblue, teal} from './DisplayPage.js'
import '../Day.css'

function Day({ image1, image2, image3 }) {
    return(
        <div className='day-container'>
        <h2 className='bdate-txt'>April 19th</h2>
        <div className='selection'>
            <img src={image1.value} alt="deep blue lipstick" className='deepblue' id='selec-pic'></img>
            <img src={image2.value} alt="navyblue lipstick" className='navyblue' id='selec-pic'></img>
            <img src={image3.value} alt="teal" className='teal' id='selec-pic'></img>
        </div>
    </div>
    )
}

export default Day
